offers.description:
Продам отличный автомобиль!
Без дтп с прозрачной историей.
На автомобиль установлено следующее дополнительное оборудование:
Экстерьер:
Обвес:
передний бампер губа - Perfom.
юбка и задний - M style;
Колеса Hamman r20 разноширокая резина;
Кузов обтянут дорогой пленкой (видео без пленки покажу при встрече);
Камера заднего вида;
Интерьер:
Потолок и стойки - дымчатая алькантара;
Вставки в торпеду и двери - карбон;
Установлена проекция на лобовое стекло (выводит: скорость, навигацию, при установке доп датчика и ограничения по скорости);
Установлен антирадар с видеорегистратором;
установлена лед панель приборов 3 режима: Sport Comport Eco
установлены комфортные сидения с 9 функциями регулировки + обдув;
перетянуты все сидения в оригинальную кожу с комбинацией текстур в том числе и карбон (видно на фото), 
заменены все ремни безопасности под цвет салона, 
в дверях и центральной консоли вставки из синей алькантары.
установлен охранный комплекс в Угона.нет на 180 т.р.
Общая сумма вложений в допоборудование более 1 млн.
Автомобиль хранится на теплой подземной парковке.
Возможен обмен на bmw 7 long или S class от 16 года

Реальному покупателю незначительный торг у капота. Все чеки накладные и т.д., присутствуют. 2 ключа, оригинал птс, я 2й собственник.

Вашему вниманию представляем автомобиль с пробегом Volkswagen Passat  B6

Автомобиль приобретался у официального дилера. ПТС оригинал.  Два собственника. Комфортная комплектация.
Мультимедиа: AUX.
Салон: комбинированный, 5 мест, подогрев сидений, Передний центральный подлокотник, Тонированные стекла
Комфорт: электростеклоподъемники, климат-контроль, камера заднего вида, Электропривод зеркал, мультируль
Автомобиль прошел предпродажную подготовку. Готов к эксплуатации.

Автосалон "PROFFIT" гарантирует:

— 100 % юридическую чистоту автомобиля в письменном виде;
— У нас нет скрытых доплат, платежей и комиссий;
— Автомобили прошли комплексную предпродажную подготовку;
— При обмене на Ваш автомобиль действуют скидка до 30 000 руб.;
— Есть возможность провести тест-драйв;
— Выкуп Вашего автомобиля по выгодной цене.

АВТОКРЕДИТОВАНИЕ:

— Первоначальный взнос от 0%;
— Минимальный пакет документов – паспорт и вод. удостоверение;
— Досрочное погашение без штрафов и комиссий;
— КАСКО – необязательно.
Сотрудничаем с 15 аккредитованными и сертифицированными банками РФ, среднее время ожидания решения банка 30–50 минут.

АВТОМОБИЛЬ ДОСТУПЕН К ПРОСМОТРУ В КРЫТОМ И ОСВЕЩЕННОМ ПОМЕЩЕНИИ. Ждем Вас с 9:00 до 21:00, каждый день без перерыва и выходных. Пешая доступность от метро Беломорская (300 метров).

Для покупателей с региона автосалон "PROFFIT" дарит бонусы:

— ПРИ ПОКУПКЕ ЭТОГО АВТОМОБИЛЯ В КРЕДИТ - Оплата проезда (только по билетам) для покупателей с региона;
— Помощь в постановке на учет в ГИБДД;
— Страховка и Диагностическая карта по вашему коэффициенту.

В нашем автосалоне "PROFFIT" большой выбор автомобилей разных классов – от бюджетных семейных автомобилей до внедорожников. Индивидуальный подход к каждому покупателю и гарантированные подарки, бонусы и скидки! Мы позаботимся сделать Вашу покупку более приятной и выгодной!
